import "./ContainerItem.css"
import Item from "./../Item/Item.js"

function ContainerItem({group}) {

    return(
        <div className="ContainerItem">
            <h3>{group.title}</h3>

            <div className="Collection_Of_Sets">
                {
                    group.sets.map((set)=>{
                        return set
                    })
                }


                <div className="Set_Of_Items">
                    <Item name="DeathSpiral" type="WeaponsEvolved"/>
                    <Item name="Axe" type="WeaponsBase"/>
                    <Item name="Candelabrador" type="Passive"/>
                </div>

                <div className="Set_Of_Items">
                    <Item name="UnholyVespers" type="WeaponsEvolved"/>
                    <Item name="KingBible" type="WeaponsBase"/>
                    <Item name="Spellbinder" type="Passive"/>
                </div>

            </div> {/* close div: ItemCollection */}

        </div> // close: ContainerItem
    )
}

export default ContainerItem;
